import { useState } from "react";

function Booking() {
  const [bookings, setBookings] = useState([]);
  return (
    <>
      {bookings.length > 0 ? (
        <h2>Booking</h2>
      ) : (
        <h1>no bookings at the moment</h1>
      )}
    </>
  );
}
export default Booking;
